import React from "react";
import Card from './Card'
import contacts from "../contacts";



function App() {

  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card

      name={contacts[i].name}
      imgURL={contacts[i].imgURL}
      tel={contacts[i].phone}
      email={contacts[i].email}
      />
    </div>
  );
}

export default App;
